    return (
        <Box sx={{ minWidth: 120 }}>
        <InputLabel>{label}</InputLabel>
        <Select
          label={label}
          value={value}
          hiddenLabel
        >
          <MenuItem>Test</MenuItem>
        </Select>
      </Box>
    )
}
